import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import {Routes,Route} from "react-router-dom"

function App() {


  return (
    <div>
    <Routes>
     <Route path="/header"  element= {<Header />} />

      
      </Routes>
    </div>
  );
}

export default App;
